import Dashboard from './Components/Dashboard';
import {
  BrowserRouter as Router,
  Switch,
  Route 
} from "react-router-dom";

function App() {
  return (
    <Fragment>
      <Navbar/>
      <SingIn />
      <FooterCompoment />
      <Dashboard />
    </Fragment>
  );
}

export default App;
